import React from 'react';
import NavItem from './NavItem'; // Assuming you've named your component file NavItem.js

const Navigation = ({ navItems }) => {
  return (
    <ul>
      {navItems.map((item, index) => (
        <li key={index}>
          <NavItem title={item.title} submenu={item.submenu} url={item.url} />
        </li>
      ))}
    </ul>
  );
};

export default Navigation;
